import React from 'react'
import Announcement from '../compenents/Announcement'
import Navbar from '../compenents/Navbar'
import Slider from '../compenents/Slider'

export default function Home() {
  return (
    <div>
        <Announcement />
        <Navbar />
        <Slider />
    </div>
  )
}
